import React from "react";
import "../stylesheets/top-panel.css";

const TopPanel = () => {
  return (
    <div id="top-panel-wrapper">
      <section>
        <p >About me</p>
        <p>I am a full-stack web devloper based in Salt Lake City, Utah</p>
        <p>More info ...</p>
      </section>
    </div>
  );
};

export default TopPanel;
